  true,\n\t\"url\": null,\n\t\"notes\": \"The Large Truck* Crash Causation Study (LTCCS)
  is based on a three-year data collection project conducted by the Federal Motor
  Carrier Safety Administration (FMCSA) and the National Highway Traffic Safety Administration
  (NHTSA) of the U.S. Department of Transportation (DOT). LTCCS is the first-ever
  national study to attempt to determine the critical events and associated factors
  that contribute to serious large truck crashes allowing DOT and others to implement
  effective countermeasures to reduce the occurrence and severity of these crashes.\",\n\t\"license_title\":
